import React, { useEffect, useState } from 'react';
import { FormattedMessage } from 'react-intl';
import { useHistory } from 'react-router-dom';
import {
  Learn_more,
  CloseBtn,
  Learn_more_m,
  CloseBtn_white,
  CircleCloseBtn,
} from '~components/icon/Common';
import { isMobile } from '~utils/device';
import { Swiper, SwiperSlide } from 'swiper/react';
import getConfig from '../../services/config';
import 'swiper/swiper.min.css';
import SwiperCore, { Autoplay } from 'swiper';
const { REF_VE_CONTRACT_ID } = getConfig();
SwiperCore.use([Autoplay]);

export default function PopUpSwiper() {
  const [closeStatus, setCloseStatus] = useState(true);
  const history = useHistory();
  useEffect(() => {
    const popupSwiper = localStorage.getItem('popup-announcement6');
    if (popupSwiper == '1') {
      setCloseStatus(true);
    } else {
      setCloseStatus(false);
    }
  }, []);
  const closePop = (e: any) => {
    localStorage.setItem('popup-announcement7', '1');
    e.stopPropagation();
    setCloseStatus(true);
  };
  const mobile = isMobile();
  return (
    <>
      {closeStatus ? null : (
        <div
          className={`fixed xs:left-1/2 xs:transform xs:-translate-x-1/2 md:left-1/2 md:transform md:-translate-x-1/2 z-50 lg:right-8 ${
            mobile ? 'farmPopupBoxMobile' : 'farmPopupBox'
          }`}
        >
          <Swiper
            spaceBetween={30}
            centeredSlides={true}
            autoHeight={false}
            autoplay={{
              delay: 3500,
              disableOnInteraction: false,
            }}
            loop={true}
          >
            <SwiperSlide>
              <div className="relative pt-9">
                <div
                  onClick={closePop}
                  className="flex justify-end items-center absolute top-2 right-2 cursor-pointer w-8 h-8"
                >
                  <CircleCloseBtn></CircleCloseBtn>
                </div>
                <SeatFarm
                  className="cursor-pointer"
                  onClick={() => {
                    location.href = '/v2farms/3714-r';
                  }}
                ></SeatFarm>
              </div>
            </SwiperSlide>
            <SwiperSlide>
              <div className="relative pt-9">
                <div
                  onClick={closePop}
                  className="flex justify-end items-center absolute top-2 right-2 cursor-pointer w-8 h-8"
                >
                  <CircleCloseBtn></CircleCloseBtn>
                </div>
                <NEARxFarm
                  className="cursor-pointer"
                  onClick={() => {
                    location.href = '/v2farms/3688-r';
                  }}
                ></NEARxFarm>
              </div>
            </SwiperSlide>
          </Swiper>
        </div>
      )}
    </>
  );
}
function SeatFarm(props: any) {
  return (
    <img
      {...props}
      src="data:image/png;base64,"
    ></img>
  );
}
function NEARxFarm(props: any) {
  return (
    <img
      {...props}
      src="data:image/png;base64,"
    ></img>
  );
}

